import React, { Component } from 'react';
import { ButtonGroup, Button, Divider } from '@blueprintjs/core';

export default class DashboardControllers extends Component {
   render() {
      const {
         onEdit,
         canEdit,
         onAdd,
         onDelete,
         canDelete,
         onRefresh
      } = this.props;
      return (
         <div>
            <ButtonGroup>{this.props.children}</ButtonGroup>
            <ButtonGroup>
               <Button
                  icon='edit'
                  small
                  minimal
                  onClick={onEdit}
                  disabled={canEdit}
               />
               <Button icon='add' small minimal onClick={onAdd} />
               <Button
                  icon='trash'
                  small
                  minimal
                  onClick={onDelete}
                  disabled={canDelete}
               />
               <Divider />
               <Button icon='refresh' small minimal onClick={onRefresh} />
            </ButtonGroup>
         </div>
      );
   }
}
